// Imports

// Importing React for Usage in APP
import React from 'react';

// Importing State 
import { useEffect } from 'react';

// Variables - Defined outside the APP
const API_URL = 'http://www.omdbapi.com/?apikey=a942ca70';

// Main App
const App = () => {


    const searchMovies = async(title) => { 
        const response = await fetch(`${API_URL}&s=${title}`);
        const data = await response.json();
        console.log(data);
    }

    // State
    useEffect(() => {
        searchMovies('Spiderman');
    },[]);

    // The value being returned to the Rendrer
    return (
        <h1>App</h1>
    )
}

export default App;
